import React from 'react';

const Mainpage = () => {
  document.body.style.background = "#0cc7e8";
  return (
    <>
      <div className="flex flex-col items-center justify-center min-h-screen">
        <div className="text-center text-white">
          <h6 className="text-4xl sm:text-6xl md:text-8xl">Programming</h6>
          <h2 className="text-3xl sm:text-5xl md:text-7xl">Quizz</h2>
        </div>
      </div>
    </>
  );
};

export default Mainpage;
